import React from "react";
import styled from "styled-components";
import emailIcon from "../../assets/icon/email.png"; // email.png 경로
import githubIcon from "../../assets/icon/github.png"; // github.png 경로

const Box = styled.div`
  display: flex; /* Flexbox로 설정 */
  align-items: flex-start;
  width: 1040px;
  height: 100%;
`;

const Image = styled.div`
  height: 250px;
  width: 250px;
  margin-left: 30px;
  border: 1px solid black;
  box-sizing: border-box;
`;

const Info = styled.div`
  height: 790px;
  width: 1040px;
`;

const NameText = styled.div`
  color: #4a4e4d;
  font-family: Roboto;
  font-size: 32px;
  font-style: normal;
  font-weight: 700;
  line-height: normal;
  margin-top: 10px;
  margin-bottom: 10px;
  margin-left: 30px;
  border: 1px solid black;
  box-sizing: border-box;
`;

const Text = styled.div`
  display: flex; /* 아이콘과 텍스트를 가로로 배치 */
  align-items: center; /* 아이콘과 텍스트 세로 정렬 */
  color: #4a4e4d;
  font-family: Roboto;
  font-size: 24px;
  font-style: normal;
  font-weight: 400;
  line-height: 40px;
  margin-left: 30px;
  border: 1px solid black;
  box-sizing: border-box;
`;

const IconWrapper = styled.div`
  display: flex; /* Flexbox로 아이콘 정렬 */
  align-items: center; /* 세로 중앙 정렬 */
  justify-content: center; /* 가로 중앙 정렬 (선택적) */
  margin-right: 10px; /* 아이콘과 텍스트 사이 간격 */
  border: 1px solid black;
  box-sizing: border-box;
`;

const IconImage = styled.img`
  width: 30px; /* 아이콘 너비 */
  height: 30px; /* 아이콘 높이 */
`;

export default function MyInfo() {
  return (
    <Box>
      <Image></Image>

      <Info>
        <NameText>임세연</NameText>
        <Text>ㅇㅇ 대학교</Text>
        <Text>2002.12.02</Text>
        <Text>
          <IconWrapper>
            <IconImage src={emailIcon} alt="Email Icon" />
          </IconWrapper>
          kiteyeonn@gmail.com
        </Text>
        <Text>
          <IconWrapper>
            <IconImage src={githubIcon} alt="GitHub Icon" />
          </IconWrapper>
          https://github.com/cinsy26
        </Text>
      </Info>
    </Box>
  );
}
